private void PrintWebBrowserContent()\n{\n    PrintDialog printDialog = new PrintDialog();\n    if (printDialog.ShowDialog() == true)\n    {\n        WebBrowser webBrowser = new WebBrowser();\n        webBrowser.NavigateToString(webBrowser.Document.ToString());\n        Microsoft.Win32.OpenFileDialog openFileDialog = new Microsoft.Win32.OpenFileDialog();\n        openFileDialog.Filter = "HTML Files (*.html)|*.html";\n        openFileDialog.FileName = "temp";\n        openFileDialog.ShowDialog();\n        string tempFilePath = openFileDialog.FileName;\n        using (StreamWriter writer = new StreamWriter(tempFilePath))\n        {\n            writer.WriteLine(webBrowser.Document.ToString());\n        }\n        ProcessStartInfo startInfo = new ProcessStartInfo();\n        startInfo.FileName = tempFilePath;\n        startInfo.Verb = "print";\n        Process.Start(startInfo);\n    }\n}